import React from "react";
import web from "../src/Images/img2.jpg";
//import { NavLink } from "react-router-dom";
import Common from "./Common";
import "./index.css";
 
const About = ()=>{
    return(
        <>
        <Common 
        name="welcom to about"
        
         imgsrc={web} 
         
         visit="/Contact"
          btname="contact now"/>
        </>
        );
    };
    export default  About;
